import React from "react";
import { Outlet, Link } from "react-router-dom";

const AdminDashboard = () => {
  return (
    <>
      <div>
        <div>
          <ul>
            <li>
              <Link to="AdminComponents/contacts">My Profile</Link>
            </li>
            <li>
              <Link to="AdminComponents/about">About</Link>
            </li>
            <li>
              <Link to="AdminComponents/contacts">absk</Link>
            </li>
          </ul>
        </div>
      </div>
      <Outlet />
    </>
  );
};
export default AdminDashboard;
